import React from 'react';
import LeadForm from './components/LeadForm';
import LeadList from './components/LeadList';

const App = () => {
  return (
    <div>
      <h1>CRM Dashboard</h1>
      <LeadForm />
      <LeadList />
    </div>
  );
};

export default App;
